import React, {useState} from 'react'
import "bootstrap/dist/css/bootstrap.min.css"
function App() {
    const [fullName, setFullName] = useState("");
    const [username, setUsername] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");


    const handleSubmit = async (e) => {
        e.preventDefault();
        
        };


    return (
        <div>
            <div className="container">
                <div className="form-group">
                    <form onSubmit={handleSubmit} >
                        <br/>
                        <input type="text" placeholder="Full Name"  onChange={(e) => setFullName(e.target.value)} value={fullName} className="form-control" />  <br/>
                        <input type="text" placeholder="Username"   onChange={(e) => setUsername(e.target.value)} value={username} className="form-control" /> <br/>
                        <input type="email" placeholder="Email"      onChange={(e) => setEmail(e.target.value)} value={email} className="form-control" /> <br/>
                        <input type="password" placeholder="Password"   onChange={(e) => setPassword(e.target.value)} value={password} className="form-control" /> <br/>
                        <input type="submit" className="btn btn-danger btn-block" value="Submit" />
                    </form>
                </div>
            </div>
            
        </div>
    )
}

export default App
